import React from 'react'
import Banner from './home/Banner' ;

import {Helmet} from "react-helmet";


function Home() {
  return (
    <>
    <Helmet>
                <meta charSet="utf-8" />
                <title>My Title</title>
                <link rel="canonical" href="http://mysite.com/example" />
            </Helmet>
    <Banner />
    </>
  )
}

export default Home
